import Head from "next/head";
import React from "react";
import AppLayout from "../components/AppLayout";

const Profile = () => {
  return (
    <>
      <Head>
        <title>Profile | NodeBird</title>
      </Head>
      <AppLayout>
        <div>내 프로필 페이지</div>
      </AppLayout>
    </>
  );
};
export default Profile;
